INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(2, 'Le Sang des Elfes', 'Broché', 'Andrzej Sapkowski', 'SuperNOWA', 'Roman', 352, '2017-10-31', '20 €', 'Du beau royaume de Cintra, il ne reste plus que des ruines. L\'empire de Nilfgaard a tout massacré et la reine Calanthe s\'est jetée du haut des créneaux. Seule survivante, la petite princesse Ciri a réussi à fuir la capitale. Mais des espions sont aussitôt envoyés à ses trousses. L\'enfant semble avoir un rôle crucial dans la destinée de ce monde... Geralt de Riv, le chasseur de monstres, l\'a bien compris en recueillant la fillette. Conduite à Kaer Morhen, l\'antre des sorceleurs, elle y est initiée aux arts magiques. Aidé par la magicienne Merigold, Geralt découvrira la véritable nature de l\'enfant et l\'ampleur de ses pouvoirs qui suscitent la convoitise : un mystérieux sorcier est à sa recherche et n\'hésitera pas à menacer les amis du sorceleur pour arriver à ses fins...', , 8903365045, 'LeSangdesElfes_AndrzejSapkowski', NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(3, 'Le Silmarillion', 'Broché ', 'J. R. R. Tolkien', 'Allen & Unwin', 'Roman', 365, '2003-11-20', '6 € 95', 'Les Premiers Jours du Monde étaient à peine passés quand Fëanor, le plus doué des Elfes, créa les trois Silmarils. Ces bijoux renfermaient la Lumière des Deux Arbres de Valinor. Morgoth, le premier Prince de la Nuit, était encore sur la Terre du Milieu, et il fut fâché d\'apprendre que la Lumière allait se perpétuer. Alors il enleva les Silmarils, les fit sertir dans son diadème et garder dans la forteresse d\'Angband. Les Elfes prirent les armes pour reprendre les joyaux et ce fut la première de toutes les guerres. Longtemps, longtemps après, lors de la Guerre de l\'Anneau, Elrond et Galadriel en parlaient encore.', , 5263245864, 'LeSilmarillion_J.R.R.Tolkien', NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(4, 'L\'héritage, Tome 1 : Eragon', 'Broché ', 'Christopher Paolini', 'Bayard Jeunesse ', 'Roman', 698, '2010-04-04', '3 € 62', 'Eragon n\'a que quinze ans, mais le destin de l\'Empire eEragon n\'a que quinze ans, mais le destin de l\'Empire est désormais entre ses mains !C\'est en poursuivant une biche dans la montagne que le jeune Eragon, quinze ans, tombe sur une magnifique pierre bleue, qui s\'avère être... un oeuf de dragon ! Fasciné, il l\'emporte à Carvahall, le village où il vit pauvrement avec son oncle et son cousin. Il n\'imagine pas alors qu\'une dragonne, porteuse d\'un héritage ancestral, va en éclore...Très vite, la vie d\'Eragon est bouleversée. Contraint de quitter les siens, le jeune homme s\'engage dans une quête qui le mènera aux confins de l\'empire de l\'Alagaësia. Armé de son épée et guidé par les conseils de Brom, le vieux conteur, Eragon va devoir affronter avec sa dragonne les terribles ennemis envoyés par le roi Galbatorix, dont la malveillance démoniaque ne connaît aucune limite.', , 1289147820, 'L\'héritage,Tome 1:Eragon_Christopher Paolini', NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(5, 'One Piece - Tome 1 : A l\'aube d\'une grande aventure', 'One Piece', 'Eiichiro Oda', 'Glénat', 'Manga', 208, '2000-09-01', '3€80', 'Nous sommes à l\'ère des pirates. Lufy, un garçon espiègle, rêve de devenir le roi des pirates en trouvant le \" One Piece \", un fabuleux trésor. Par mégarde, Lufy a avalé un jour un fruit démoniaque qui l\'a transformé en homme caoutchouc. Depuis, il est capable de contorsionner son corps élastique dans tous les sens, mais il a perdu la faculté de nager.\r\nAvec l\'aide de ses précieux amis, dont le fidèle Shanks, il va devoir affronter de redoutables pirates dans des aventures toujours plus rocambolesques.', , 9508511147, 'OnePiece-Tome1:Al\'aubed\'unegrandeaventure_EiichiroOda', NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(6, 'Naruto: tome 1', 'Shonen Kana', 'Masashi Kishimoto', 'Kana', 'Manga', 208, '2002-03-15', '3€', 'Il est têtu, ce petit Naruto. Farceur et plein d\'imagination, mais surtout très têtu. Il n\'a qu\'une idée en tête : devenir le meilleur ninja de son village et recevoir le titre suprême de Maître Hokage. Seulement, pour ça, il faudrait qu\'il soit reçu à l\'examen. Et franchement, ce n\'est pas gagné ! Ce manga se situe dans la lignée de séries d\'aventures comme Dragon Ball ou Hunter X Hunter. Il y a de l\'action, beaucoup d\'humour, une vraie fantaisie. C\'est aussi une bonne introduction à l\'art martial du Ninjutsu, à ses rites et à ses traditions. Et Naruto est un personnage diablement attachant, plein d\'entrain malgré ses fêlures intérieures...', , 6055895824, 'Naruto:tome1_MasashiKishimoto', NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(7, 'L\'Outsider', 'A.M.S.KING', 'Stephen King', 'Albin Michel', 'Roman policier, Horreur', 576, '2019-01-30', '24,90 €', 'Le corps martyrisé d\'un garçon de onze ans est retrouvé dans le parc de Flint City. Témoins et empreintes digitales désignent aussitôt le coupable : Terry Maitland, l\'un des habitants les plus respectés de la ville, entraîneur de l\'équipe locale de baseball, professeur d\'anglais, marié et père de deux fillettes. Et les résultats des analyses d\'ADN ne laissent aucun doute. Dossier classé. À un détail près : Terry Maitland a un alibi en béton. Et des preuves tout aussi irréfutables que les preuves qui l\'accusent.\r\nQui se cache derrière ce citoyen au-dessus de tout soupçon ?', , 8410690752, 'L\'Outsider_StephenKing', NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(8, 'Shining, l\'enfant lumière', 'Kindle', 'Stephen King', 'JC Lattès', 'Roman, Horreur', 422, '1977-01-28', '7,99 €', 'Situé dans les montagnes Rocheuses, l’Overlook Hotel est tenu pour être l’un des plus beaux lieux du monde. Beauté, confort, luxe, volupté…L’hiver, l’hôtel est fermé, coupé du monde par le froid, la neige, les glaces. Seul l’habite un gardien. Cet hiver-là, c’est Jack Torrance, un alcoolique qui tente d’échapper à l’échec et au désespoir. Il est venu accompagné de sa femme, Wendy, qui espère, grâce à cet isolement, reconstruire son foyer menacé, et de leur enfant, Danny.\r\nMais Danny possède le don de sentir, de voir, de ressusciter les choses et les êtres à jamais disparus. Dans les cent dix chambres vides de l’Overlook, le démon est omniprésent. Cauchemar ou réalité, le corps de cette femme assassinée, ces bruits de fête qui derivent dans les couloirs, cette vie si étrange qui anime l’hôtel ?', , 4838472996, 'Shining,l\'enfantlumière_StephenKing', NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(9, 'L\'Institut ', 'A.M.S.KING', 'Stephen King', 'Albin Michel', 'Roman', 608, '2020-01-29', '24,90 €', 'Au coeur de la nuit, à Minneapolis, des intrus pénètrent la maison de Luke Ellis, jeune surdoué de 12 ans, tuent ses parents et le kidnappent.\r\n\r\nLuke se réveille à l\'Institut, dans une chambre presque semblable à la sienne, sauf qu\'elle n\'a pas de fenêtre. Dans le couloir, d\'autres portes cachent d\'autres enfants, dotés comme lui de pouvoirs psychiques.\r\n\r\nQue font-ils là ? Qu\'attend-on d\'eux ? Et pourquoi aucun de ces enfants ne cherche-t-il à s\'enfuir ?', , 7700549449, 'L\'Institut_StephenKing', NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(10, 'Ça, tome 1', 'Fantastique', 'Stephen King', 'Le Livre de Poche', 'Roman, Horreur', 799, '2002-02-13', '9,20 €', 'Enfants, dans leur petite ville de Derry, Ben, Eddie, Richie et la petite bande du « Club des ratés », comme ils se désignaient, ont été confrontés à l’horreur absolue : ça, cette chose épouvantable, tapie dans les égouts et capable de déchiqueter vif un garçonnet de six ans…\r\nVingt-sept ans plus tard, l’appel de l’un d’entre eux les réunit sur les lieux de leur enfance. Car l’horreur, de nouveau, se déchaîne, comme si elle devait de façon cyclique et régulière frapper la petite cité.\r\nEntre le passé et le présent, l’enfance et l’âge adulte, l’oubli des terreurs et leur insoutenable retour, l’auteur de Sac d’os nous convie à un fascinant voyage vers le Mal, avec une de ses œuvres les plus amples et les plus fortes.', , 3535628560, 'Ça,tome1_Stephen King', NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(11, 'Ça, tome 2', 'Fantastique', 'Stephen King', 'Le Livre de Poche', 'Roman, Horreur', 638, '2002-02-13', '8,90 €', 'De retour, après vingt-sept années, dans leur petite ville de Derry, les membres du « Club des ratés » (ainsi se nommaient-ils eux-mêmes sur les bancs de l’école) doivent affronter leurs plus terrifiants souvenirs, brutalement ressurgis.\r\nça : nul ne sait nommer autrement la chose inconnue qui semble devoir se réveiller cycliquement dans les entrailles de la ville, pour semer la mort et l’épouvante.\r\nRoman de l’enfance, tableau saisissant de la vie américaine, cette œuvre ambitieuse est une parabole du Mal enfoui, refoulé, et de la violence de ses réapparitions. C’est enfin, et surtout, une des plus grandes œuvres de Stephen King, un festival de terreur.', , 1051067867, 'Ça,tome2_Stephen King', NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `editeur`, `genre`, `nombrePage`, `dateSortie`, `prix`, `synopsys`, `image`, `ReferenceBook`, `ReferenceGroupe`, `id_commandebooks`) VALUES
(13, 'Ça, tome 2', 'Fantastique', 'Stephen King', 'Le Livre de Poche', 'Roman, Horreur', 638, '2002-02-13', '8,90 €', 'De retour, après vingt-sept années, dans leur petite ville de Derry, les membres du « Club des ratés » (ainsi se nommaient-ils eux-mêmes sur les bancs de l’école) doivent affronter leurs plus terrifiants souvenirs, brutalement ressurgis.\r\nça : nul ne sait nommer autrement la chose inconnue qui semble devoir se réveiller cycliquement dans les entrailles de la ville, pour semer la mort et l’épouvante.\r\nRoman de l’enfance, tableau saisissant de la vie américaine, cette œuvre ambitieuse est une parabole du Mal enfoui, refoulé, et de la violence de ses réapparitions. C’est enfin, et surtout, une des plus grandes œuvres de Stephen King, un festival de terreur.', , 1051067867, 'Ça,tome2_Stephen King', NULL);

